interface NavItemProps {
  title: string;
  icon: any;
}

interface TicketOption {
  id: string;
  title: string;
  price: number;
  details: string;
  image: string;
}

interface ThingsToDoItem {
  id: string;
  title: string;
  rating: number;
  booked: string;
  price: string;
  location: string;
  desc: string;
  image: string;
  ticketOption: TicketOption[];
  date: string;
}

interface AttractionItem {
  id: string;
  image: string;
  desc: string;
  title: string;
  rating: number;
  booked: string;
  price: string;
  location: string;
  ticketOption: TicketOption[] | null;
  date: string;
}

export type RootStackParamList = {
  ThingsToDo: undefined;
  ItemDetails: { item: ThingsToDoItem };
  Attractions: undefined;
  AttractionDetails: { item: AttractionItem };
  Cart: undefined;
  Home: undefined;
  BookingPage: { bookItem: BookItem };
  PackageOption: { item: ThingsToDoItem };
  PaymentPage: { bookingDetails: BookingDetails | null };
  BookingHistory: { bookingHistory: BookingDetails[] };
  PaymentSuccess: undefined;
  Event:undefined;
  ReviewsScreen: { item: AttractionItem };
  AccountScreen:undefined;
};


interface Traveler {
  type: 'adult' | 'senior' | 'child' | 'infant';
  count: number;
}

interface BookItem {
  id: string;
  image: string;
  name: string;
  option: TicketOption;
  date: string;
  time: string;
  quantity: number;
  travelers: Traveler[];
}

interface BookingDetails {
  firstName: string;
  lastName: string;
  myKad: string;
  email: string;
  contact: string;
  subtotal: number;
  ticket: BookItem;
}

type ThingsToDoScreenNavigationProp = StackNavigationProp<RootStackParamList, 'ThingsToDo'>;

type Props = {
  navigation: ThingsToDoScreenNavigationProp;
};

interface PriceFilterModalProps {
  visible: boolean;
  onClose: () => void;
  onApply: (selectedRanges: Record<string, boolean>, selectedLocations: string[], selectedMonths: string[]) => void;
}

