        desc: 'Penang National Park is located at the northwest corner of Penang Island overlook the Straits of Malacca. The park is about 390 km from Kuala Lumpur and about 42 km from Georgetown, Penang. By own transport, drive through the North South Expressway, exit at the junction of Penang Bridge. Follow the road towards the direction of Batu Feringghi and continues to Teluk Bahang. Administrative Office of the Penang National Park is located at Jalan Hassan Abbas. Public transport to Teluk Bahang available at ferry terminal / KOMTAR or may use taxi or bus services provided',
